function addLinkTarget(){document.querySelectorAll(".fh5co-blog").forEach(n=>{n.querySelectorAll("a").forEach(n=>{n.setAttribute("target","_blank")})})}function playMusic(){var n=document.getElementById("player");try{n.addEventListener("ended",()=>{setTimeout(()=>{n.src=musicSrc+"?"+Math.random(),n.play()},1e3)});n.play()}catch(t){}}function initHome(){musicSrc=document.getElementById("player").src;playMusic();addLinkTarget()}var musicSrc=undefined;initHome();